	{title:"義大利麵", image:"./1.jpg"}

]

export default Menu = () =>{

	return (
		<>
		fakemenu.map(
			dish=><AnimateButton imageUrl={dish.image} imageTitle={dish.title} imageWidth={"30%"}></AnimateButton>) 
		</>
	)	
}
